import { NavLink } from "react-router-dom";
const Navbar = () => {
  return (
  <div className="">
    <nav className="flex justify-between items-center h-20 max-w-6xl mx-auto">
      <NavLink to="/">
      <div>
      
      </div>
        
      </NavLink>
      <div>
        <NavLink to="/">
          <p>Home</p>
        </NavLink>
        <NavLink to="/cart">
          <FaShoppingCart/>
        </NavLink>
      </div>
    </nav>
  </div>
  )
};

export default Navbar;
